import com.fasterxml.jackson.core.type.TypeReference;
import com.fasterxml.jackson.databind.JsonNode;
import com.fasterxml.jackson.databind.ObjectMapper;
import com.fasterxml.jackson.databind.SerializationFeature;
import org.glassfish.jersey.client.ClientConfig;
import ru.myt.core.entity.Train;
import ru.myt.core.entity.UserSettings;
import ru.myt.integration.simpleObject.SimpleEvent;

import javax.ws.rs.client.Client;
import javax.ws.rs.client.ClientBuilder;
import javax.ws.rs.client.Invocation;
import javax.ws.rs.client.WebTarget;
import javax.ws.rs.core.MediaType;
import javax.ws.rs.core.Response;
import javax.ws.rs.core.UriBuilder;
import java.io.IOException;
import java.net.URI;
import java.util.ArrayList;
import java.util.List;

public class EventAPITest {

    public static void main(String args[]) throws IOException {

        ClientConfig config = new ClientConfig();
        Client client = ClientBuilder.newClient(config);
        ObjectMapper mapper = new ObjectMapper().enable(SerializationFeature.INDENT_OUTPUT);

        //1
        URI uri = UriBuilder.fromUri("http://localhost:8080/MYTServer/api/mock/event/1").build();
        WebTarget service = client.target(uri).queryParam("lastEventId", "3jd74292838");
        Invocation.Builder invocationBuilder =	service.request(MediaType.APPLICATION_JSON).accept(MediaType.APPLICATION_JSON);
        Response response = invocationBuilder.get();
        SimpleEvent obj = mapper.readValue(response.readEntity(String.class), SimpleEvent.class);
        System.out.println("mockEvent: " + obj);

        System.out.println(service.request().accept(MediaType.APPLICATION_JSON).get(String.class));


        //2
        uri = UriBuilder.fromUri("http://localhost:8080/MYTServer/api/mock/event/2").build();
        service = client.target(uri).queryParam("lastEventId", "3jd74292838");
        invocationBuilder =	service.request().accept(MediaType.APPLICATION_JSON);
        response = invocationBuilder.get();

        String input = response.readEntity(String.class);
        obj = mapper.readValue(input, SimpleEvent.class);

        System.out.println("mockEvent2: " + obj);
        ArrayList<Train> availableTrains = (ArrayList<Train>) obj.getEventPayload();

        JsonNode root = mapper.readTree(input);
        JsonNode eventPayload =root.findValue("eventPayload");
        //for (JsonNode node: eventPayload.){

        List<Train> myObjects = mapper.readValue(eventPayload.toString(), new TypeReference<List<Train>>(){});





        //3
        uri = UriBuilder.fromUri("http://localhost:8080/MYTServer/api/mock/event/3").build();
        service = client.target(uri).queryParam("lastEventId", "3jd74292838");
        invocationBuilder =	service.request().accept(MediaType.APPLICATION_JSON);
        response = invocationBuilder.get();

        input = response.readEntity(String.class);
        obj = mapper.readValue(input, SimpleEvent.class);

        root = mapper.readTree(input);
        JsonNode result =root.findValue("eventPayload");

        UserSettings obj2 = mapper.readValue(result.toString(), UserSettings.class);
        System.out.println("mockEvent3: " + obj2);
        obj.setEventPayload(obj2);

        //4
        uri = UriBuilder.fromUri("http://localhost:8080/MYTServer/api/mock/event/4").build();
        service = client.target(uri).queryParam("lastEventId", "3jd74292838");
        invocationBuilder =	service.request().accept(MediaType.APPLICATION_JSON);
        response = invocationBuilder.get();
        obj = mapper.readValue(response.readEntity(String.class), SimpleEvent.class);
        System.out.println("mockEvent4: " + obj);
        String str = (String) obj.getEventPayload();

        //5
        uri = UriBuilder.fromUri("http://localhost:8080/MYTServer/api/mock/event/5").build();
        service = client.target(uri).queryParam("lastEventId", "3jd74292838");
        invocationBuilder =	service.request().accept(MediaType.APPLICATION_JSON);
        response = invocationBuilder.get();
        obj = mapper.readValue(response.readEntity(String.class), SimpleEvent.class);
        System.out.println("mockEvent5: " + obj);
        int integr = (int) obj.getEventPayload();


    }

}

